import { useState } from "react";

function Card() {

    let [nutrients, setNutrients] = useState(['Omega-3', 'multivitimin'])

    return (
        <>
            {
                nutrients.map((data, i) => {
                    return (
                        <span className="absolute bg-indigo-500 rounded-full h-4 w-4  border-indigo-500 -ml-67px"></span>
                    )
                })
            }
        </>
    )
}

export default Card;
